sys_variable_value.value:
(function execute(inputs, outputs) {
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gogle_vpn_spoke.fetch_addresses', {
        "project_id": inputs.projectid,
        "region": inputs.region
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var addresses = [];
    obj.forEach(function(addressObj) {
        addresses.push({
            "label": addressObj.name.toUpperCase(),
            "name": addressObj.name
        });
    })
    outputs.addresses = {
        data: addresses
    }
})(inputs, outputs);

